tables.table_schema:
CREATE TABLE quantum_packets (
    packet_id INT PRIMARY KEY,
    source_id INT,
    destination_id INT,
    quantum_data VARCHAR
);

CREATE TABLE routing_optimizations (
    optimization_id INT PRIMARY KEY,
    packet_id INT,
    optimization_result VARCHAR
);

CREATE TABLE QuantumNodes (
    node_id INT PRIMARY KEY,
    node_name VARCHAR(50),
    location VARCHAR(100)
);

CREATE TABLE quantum_devices (
  device_id INT PRIMARY KEY,
  device_name VARCHAR(50) NOT NULL,
  device_type VARCHAR(50) NOT NULL,
  quantum_capability VARCHAR(50) NOT NULL
);

CREATE TABLE quantum_links (
  link_id INT PRIMARY KEY,
  source_device INT NOT NULL,
  destination_device INT NOT NULL,
  link_capacity INT NOT NULL
);
